import React from "react";
import LoginFormModal from "./LoginModal";
import SignupFormModal from "./SignupFormModal";

function TopBox() {
  return (
    <div className="topImageContainer">
      <div className="navButtons">
        <LoginFormModal />
        <SignupFormModal />
      </div>
      </div>
  );
}

export default TopBox;
